import React from 'react'
import {useSpring ,animated} from 'react-spring';

function App() {
  const props = useSpring({ x: 100, from: { x: 90 } })
return (
  <animated.svg strokeDashoffset={props.x}>
    <path d="100" />
  </animated.svg>
)
}



export default App
